const theme = {
    colors: {
        textPrimary: '#24292e',
        textSecondary: '#586069',
        primary: '#0366d6',
        white: '#ffffff',
    },
    fontSizes: {
        body: 14,
        subheading: 16
    },
    font: {
        main: 'System'
    },
    fontWeights: {
        normal: '400',
        bold: '700'
    },
    appBar: {
        backgroundColor: '#24292e',
        color: '#ffffff',
        fontSize: 20,
    }
}

export default theme;
